window.bookSummaryJSON = "<p>What doesn’t kill you isn’t trying hard enough.</p> <p>Connor has vanquished The Bad Princess and taken control of Cristallur. But what of the rest of Devon? What of the other four continents? If he stands still, he will surely fall.</p> <p>Edward must plot his next move, but is someone or something anticipating his every choice? Will a sudden compulsion prove all their undoing?</p> <p>Ellen is stuck. How can she travel her Civilization Trail if the lands of Devon inhibit her progress?</p> <p>Yosaku has a challenge she mustn’t forget. What lies behind the doors that line the Tower of Tricolor, and what are the sisters up to?</p> <p>Gilbane Gilbane is stuck defending the North. Is he marginalized? Is he vulnerable? When he bumps into a stranger and befriends him, will that chance meeting test his loyalty to Connor?</p> <p>Dave is Dave, and he is getting stranger. Worryingly so.</p> <p>Have we seen the last of Altradees?</p> <p>Jump aboard for the penultimate book in the Warlords of the Circle Sea saga. The final book, Dragon’s End, is written and currently in edit.</p> <p>Contains curse words.</p> <p>Lots of them.</p>"; 
